import React from 'react';
import { IonPage, IonLabel } from '@ionic/react';





class login{
  show(){
    const Login: React.FC = () => {  
      return (
        <IonPage>
          <IonLabel>testing this</IonLabel>
        </IonPage>
      );
    };
  }
}
var L = new login()
export default L.show;
